import React, { Component } from 'react';

export default class Contact extends Component () {
    constructor(props){
        super(props);
        this.state = {
            authenticate: ''
        }
    }

    render(){
        return (
            <div className="primary col-8">
                <form id="authenticate">
                    <div className="form-group rounded">
                        <label htmlFor="authenticate" value="authenticate">Authenticate</label>
                        <input className="form-control" type="text" name="name" id="project-name" />
                    </div>
                    <div className="form-group rounded text-right" id="btn-control">
                        <button onClick={this.onClick} className="btn btn-primary" value="Add Project" id="project-submit">Add Project</button>
                    </div>
                </form>
            </div>
        );
    }

}
